import { Menu } from 'antd';
import { PureComponent } from 'react';

export default class Filter extends PureComponent {

    render() {
        return (
            <Menu
                onClick={this.handleClick}
                style={{ width: 256 }}
                defaultSelectedKeys={['1']}
                defaultOpenKeys={['sub1']}
                mode="inline"
            >
                Place the filter here
            </Menu>
        );
    }
}
